import React, { useContext, useState } from "react";
import useEth from "../../contexts/EthContext/useEth";
import { shortenAddress } from '../../utils/addressShortener';

const SITNFT = () => {
  const { state } = useEth();
  // console.log(state.artifact);
  // console.log(state.contractSS);
  console.log(state.contractsitnft.methods);

  return (
    <div className='page-two container'>
      <h2 className="pb-2 border-bottom text-start mt-5">SITNFT.</h2>
      <div class="row g-3 mt-3">
        <div class="col-sm-6">
          <label for="firstName" class="form-label">First name</label>
          <input type="text" class="form-control" id="firstName" placeholder="" value="" required=""/>
            <div class="invalid-feedback">
              Valid first name is required.
            </div>
        </div>
        <div class="col-sm-6">
          <label for="lastName" class="form-label">Last name</label>
          <input type="text" class="form-control" id="lastName" placeholder="" value="" required=""/>
            <div class="invalid-feedback">
              Valid last name is required.
            </div>
        </div>
        <button class="w-100 btn btn-primary btn-md mt-3" type="submit">Continue to checkout</button>
      </div>
    </div>
  );
};

export default SITNFT;
